import React, {useEffect, useState} from "react";
import {useNavigate} from "react-router-dom";
import Header from "../include/Header";
import Table from 'react-bootstrap/Table';
import Button from 'react-bootstrap/Button';

function Dashboard() {
    const [cars, setCars] = useState([]);
    const [success, setSuccess] = useState([]);

    useEffect(() => {
        fetch('http://localhost:8000/api/carData')
            .then(response => response.json())
            .then(data => setCars(data))
            .catch(error => console.error(error));
    }, []);

    const carDelete = (carId) => {
        fetch('http://localhost:8000/api/carData/$id',{
            method: 'DELETE'
        })
            .then(response => response.json())
            .then(success => setSuccess(success))
            .catch(error => console.error(error));

    }

    return (
        <div>
            <Header/>
            <Table striped bordered hover size="sm">
                <thead>
                <tr>
                    <th>Brand</th>
                    <th>Model</th>
                    <th>Price per day</th>
                    <th>Fuel Type</th>
                    <th>Gearbox</th>
                    <th>Availability</th>
                    <th>Actions</th>
                </tr>
                </thead>
                <tbody>
                {cars.map(car=>

                <tr>
                    <td>{car.brand}</td>
                    <td>{car.model}</td>
                    <td>{car.price}</td>
                    <td>{car.fuel}</td>
                    <td>{car.gearbox}</td>
                    <td>{car.availability}</td>
                    <td><Button variant="secondary" onClick={()=> carDelete(car.id)} >Delete</Button>
                        <Button className="m-lg-1" variant="secondary">Edit</Button></td>
                </tr>
                )}
                </tbody>
            </Table>
        </div>
    );
}

export default Dashboard
